import React from "react";

const TodoItem = ({ todo }) => {
  return (
    <div>
      <div>
        <h2>{todo.title}</h2>
        <p>{todo.description}</p>
      </div>

      <samp>{todo.isDone ? "Done" : "Not Done"}</samp>
    </div>
  );
};

export default TodoItem;
